import React, { Component } from 'react';
import { NavDropdown } from 'react-bootstrap';

export class Dropdown extends Component { 

    state = {
        address: this.getDiplomaStorageAddress()
    }

    getDiplomaStorageAddress () {
        return this.props.match.params.address
        }

    render() {
        return ( 
            
         <NavDropdown title="Functions" id="basic-nav-dropdown" className ="text-white text-uppercase ml-5">
            <NavDropdown.Item href="">Render Students</NavDropdown.Item>
            <NavDropdown.Item>Another action</NavDropdown.Item>
            <NavDropdown.Item>Something</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
        </NavDropdown>
        )
    }

    onSubmitRenderStudents(event) {
        event.preventDefault();
         this.props.history.push(`/RenderStudents/${this.state.address}`)
    }
}

export default Dropdown;
